// Profile.js
import React from 'react';

const Profile = () => {
  return (
    <div className="container my-5">
      <div className="row">
        <div className="col-md-4">
          <div className="card">
            <img src="your-profile-image.jpg" alt="Profile" className="card-img-top" />
            <div className="card-body">
              <h5 className="card-title">Your Name</h5>
              <p className="card-text">Your Bio</p>
            </div>
          </div>
        </div>
        <div className="col-md-8">
          <div className="card">
            <div className="card-body">
              <h2 className="card-title">My Profile</h2>
              <p className="card-text">Profile information and settings go here.</p>
              <a href="#" className="btn btn-primary">Edit Profile</a>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Profile;
